   "source": [
    "admission_num <- (admissions[, -c(8:14)])\n",
    "K_list <- 2:30\n",
    "total_dist <- 0\n",
    "for (k in K_list){\n",
    "  kmeans_num_choose <- kmeans(admission_num, k)\n",
    "  total_dist <- c(total_dist, kmeans_num_choose$tot.withinss)\n",
    "}\n",
    "plot(total_dist[-1])"
   ]
